import "./App.css";
import Images from "./Images";

function App() {
    return (
        <div className="App">
            <header className="App-header">
                SVG Optimizer
                <h6>Chops long path data values into smaller ones</h6>
            </header>

            <Images />
        </div>
    );
}

export default App;
